import { useState } from 'react';
import { Link } from 'react-router-dom';
import cart from '../Assets/cart-icon.svg';
import logo from '../Assets/logo.png';
export const Navbar = () => {
  const [page, setPage] = useState<string>('home');
  const onClickPage = (currPage: string) => {
    return setPage(currPage);
  }
  const setHrTag = (currPage: string) => {
    console.log(page, currPage)
    if (page === currPage) {
        return <hr/>;
    }
    return null;
  }

  return (

    <div className='navbar'>
        <div className = 'navbar-logo'>
            <img src = {logo} alt = ""/>
            <p className = 'navbar-shop-name'>East End</p>
            <p className = 'navbar-shop-name-trade-mark'>TM</p>
        </div>
        <ul className = "navbar-section">
            <li onClick ={ () => onClickPage('home')}><Link to ="/" className = "navbar-link-tag">Home</Link>{setHrTag("home")}</li>
            <li onClick = { () => onClickPage('mens')}> <Link to = "/mens" className = "navbar-link-tag">Coffee</Link>{setHrTag("mens")} </li>
            <li onClick = { () => onClickPage('women')} > <Link to = "/women" className = "navbar-link-tag">Dessert</Link>{setHrTag("women")} </li>
            <li onClick = { () => onClickPage('kids')} > <Link to = "/kids" className = "navbar-link-tag">Merch</Link>{setHrTag("kids")} </li>
        </ul>
        <div className='navbar-login'>
            <Link to ='/login'><button>Login</button></Link>
            <Link to ='/cart'><img src = {cart} alt = ""/></Link>
            <div className = "navbar-cart-count">0</div>
        </div>
    </div>
  )
}
